const Rooms = () => {
  return (
    <>
    <Hero hero="roomsHero">
      <Banner title="our rooms">
        <Link to="/" className="btn-primary">
            return home
        </Link>
      </Banner>
    </Hero>
    <RoomContainer />
    </>
  );
};

export default Rooms;
